        private void SecondSetup(GenerationProgress progress)
        {
            bool success = false;
            int attempts = 0;
            while (!success)
            {
                attempts++;
                if (attempts > 1000)
                {
                    success = true;
                    continue;
                }
                int i = ((Main.maxTilesX / 2) - 20);
                int j = ((Main.maxTilesY / 2) - 20);
                success = MOAR(i, j, progress);
            }
        }
        private bool MOAR(int i, int j, GenerationProgress progress)
        {
            if (i != (Main.maxTilesX / 2) - 20 || j != (Main.maxTilesY / 2) - 20)
